(7740, 'in', 'This image is visible in all product box. Use 300x300 sizes image. Keep some blank space around main object of your image as we had to crop some edge in different devices to make it responsive.', 'यह छवि सभी उत्पाद बॉक्स में दिखाई देती है। 300x300 आकार की छवि का उपयोग करें। अपनी छवि के मुख्य ऑब्जेक्ट के चारों ओर कुछ खाली जगह रखें क्योंकि हमें इसे उत्तरदायी बनाने के लिए विभिन्न उपकरणों में कुछ किनारे लगाने थे।', '2021-02-09 07:08:46', '2021-02-09 07:08:46'),
