(16342, 'vn', 'These images are visible in product details page gallery. Use 600x600 sizes images.', 'Những hình ảnh này có thể nhìn thấy trong thư viện trang chi tiết sản phẩm. Sử dụng hình ảnh kích thước 600x600.', '2021-02-09 08:05:52', '2021-02-09 08:05:52'),
