(17813, 'lk', '4. After uploading products you need to edit them and set products images and choices.', '4. தயாரிப்புகளை பதிவேற்றிய பிறகு நீங்கள் அவற்றைத் திருத்த வேண்டும் மற்றும் தயாரிப்புகளின் படங்களையும் தேர்வுகளையும் அமைக்க வேண்டும்.', '2021-02-09 08:13:51', '2021-02-09 08:13:51'),
